/** Global Date Picker Options **/
var now = new Date();
var pickerOpts = {
	"statusFormat": "l-cc-sp-d-sp-F-sp-Y",
	"noDrag": true,
	"noFadeEffect": true,
	"rangeLow": now.getFullYear() + "" + pad(now.getMonth()+1) + pad(now.getDate())
};

/** Fields to receive date picker **/
var dateFields = [ 'fldDepartDate', 'fldReturnDate', 'fldPickupDate', 'fldDropoffDate' ];

/** Pad the specified value with zeroes **/
function pad (value, length) {
	var length = length || 2; 
	return "0000".substr(0,length - Math.min(String(value).length, length)) + value;
};

window.onload = function () {
	/* Disable star rating if a hotel is selected */
	var fldHotel = document.getElementById('fldHotel');
	var fldRating = document.getElementById('fldRating');
	if (fldHotel) {
		fldHotel.onchange = function (event) {
			if (fldHotel.selectedIndex != 0) {
				fldRating.selectedIndex = 0;
				fldRating.disabled = true;
			} else {
				fldRating.disabled = false;
			}
		};
	}

	/* Activate date pickers */
	for (i=0; i<dateFields.length; i++) {
		if (fieldEl = document.getElementById(dateFields[i])) {
			// Add hasDatePicker class to field, to fit date picker
			fieldEl.className += ' hasDatePicker';

			/* Setup & Initialize date picker */
			var formElements = {};
			formElements[dateFields[i]] = "d-sl-m-sl-Y";
			pickerOpts["formElements"] = formElements;
			datePickerController.createDatePicker(pickerOpts);
		}
	}
};

